I’ve never fully endorsed a skincare treatment on my feed before because generally I feel like women have so much thrown at them with beauty hacks and tricks and unrealistic expectations that I didn’t want to add to it. 

But I’ve spent *A LOT* of time trying different facials and face treatments to find one that naturally rejuvenates your skin. 

Looking like a Barbie with an unnatural face isn’t my goal. I want to look like me but refreshed & glowy, with healthy skin. That’s my goal. 

Last week, I tried CO2 cool peel laser for the first time. And I have truly never found anything that has floored me like this 👀 I’d never say that if I didn’t mean it. 

My girl @lotus.aesthetics.srq in Sarasota did the treatment that @coolpeel_chad recommended and I can’t recommend her and this product enough. 

Women: you’re beautiful the way you are. Do whatever you want to do & whatever makes you happy to complete your look or keeps your skin glowing. You do you ♥️

But for me? That’s now CO2 laser because ohhhhhh myyyy gosh was it effective. 

I’ll be doing this treatment likely until the grave 😁

Takes about 15 minutes, if that. There’s a tinyyyyy bit of BRIEF pain/discomfort but it’s nothing more than a zap that feels like a mean mosquito bite. 

Your face feels and looks like you got a rough sunburn for about 3 hours afterwards and you are red the next day. But that’s normal and part of the process and oh my goodness so worth it. 

By day 2 my skin was looking glowy already but still healing with a lot of redness. I still could go places and be just fine out and about—I just looked like I had a rough sunburn.

By day 4 and day 5? I felt like I had turned back the clock 👀 So much glow. So much plump. So healthy looking. All so worth it and so natural. 

